import React from "react";
import { connect } from "react-redux";

const DriverProfileList = props => {
  const { driver } = props;
  return (
    <div>
      <div>Hello {props.title}</div>
      <div>Posted by {driver.authorFirstName}</div>
      <div>Posted by {driver.authorLastName}</div>
    </div>
  );
};

export default connect()(DriverProfileList);
